import React, {Component} from 'react';
import {Container, Form} from "react-bootstrap";
import soloPhoto from "../../assets/solo-image.jpg";
import SubTitle from "../SubTitle/SubTitle";
import SimpleText from "../SimpleText/SimpleText";

function Invitation(props) {
        return (
            <div className="invitation-container">

                    <div className = "invitation-text">
                      <SubTitle text="Запрошую на індивідуальні консультації."/>
                        <SimpleText text="Теми з якими я працюю: стосунки в сім'ї, парі, самооцінка та самоцінність, самореалізація, депресія, панічні атаки та страхи,
                                          психосоматичні симптоми, втрати, дитячий травматичний досвід, життєві ресурси, особисті кордони та інші.
                                          Проводжу супервізію для психологів та психотерапевтів."/>

                    </div>
                    <div className="invitation-img">
                        <img
                            src={props.img}
                            height="110%"
                            width="100%"
                            alt="background"
                        />
                    </div>

            </div>
        );
}
export default Invitation;
